import React from "react";
import "../../App.css";

function Products() {
  return (
    <h1 className="products">
      I am a software engineer with over four years of experience in Web and
      Game Development. I have a passion for learning and creating all sorts of
      applications. I enjoy getting to work with others to develop new and
      creative projects.
    </h1>
  );
}

export default Products;
